function uuidv4(){return"xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx".replace(/[xy]/g,function(t){var e=16*Math.random()|0;return("x"==t?e:3&e|8).toString(16)})}function auth(){let t=uuidv4();sessionStorage.setItem("state-github-basic-auth",t),open("https://github.com/login/oauth/authorize?client_id=691fff7551bb080c0ab2&state="+t+"&scope=public_repo&redirect_uri=https://smileycreations15.com/website-builder/auth","_self")}function build_site(){null!==localStorage.getItem("github-scope")&&localStorage.getItem("github-scope").split(",").includes("public_repo")?window.open("/website-builder/1"):auth()}
